import React, { useState } from "react";
import { Link } from "react-router-dom";

const StartEnd = (props) => {
    // 定义按钮样式
    const btn = {
        display: "block",
        padding: "21px",
        margin: "7px",
        minWidth: "max-content",
        textAlign: "center",
        width: "333px",
        alignSelf: "center",
    };

    const [history, setHistory] = useState([]);
    const [showHistory, setShowHistory] = useState(false);

    const fetchElectionHistory = async () => {
        try {
            // 调用智能合约的函数来获取选举历史
            const electionHistory = await props.contract.methods.getElectionHistory().call();
            setHistory(electionHistory);
            setShowHistory(true);
        } catch (error) {
            console.error("Error fetching election history:", error);
        }
    };

    return (
        <div className="container-main" style={{ borderTop: "1px solid", marginTop: "0px" }}>
            {!props.elStarted ? (
                <>
                    {!props.elEnded ? (
                        <>
                            <div className="container-item attention" style={{ display: "block" }}>
                                <h2>不要忘记添加候选人。</h2>
                                <p>
                                    前往{" "}
                                    <Link
                                        title="添加新的"
                                        to="/addCandidate"
                                        style={{ color: "black", textDecoration: "underline" }}
                                    >
                                        添加候选人
                                    </Link>{" "}
                                    页面。
                                </p>
                            </div>
                            <div className="container-item">
                                <button type="submit" style={btn}>
                                    开始选举{props.elEnded ? "（再次）" : null}
                                </button>
                            </div>
                        </>
                    ) : (
                        <div className="container-item">
                            <center>
                                <p>重新部署合约以再次开始选举。</p>
                            </center>
                        </div>
                    )}
                    {props.elEnded ? (
                        <div className="container-item">
                            <center>
                                <p>选举已结束。</p>
                            </center>
                        </div>
                    ) : null}
                </>
            ) : (
                <>
                    <div className="container-item">
                        <center>
                            <p>选举已开始。</p>
                        </center>
                    </div>
                    <div className="container-item">
                        <button
                            type="button"
                            onClick={props.endElFn} // 点击按钮结束选举
                            style={btn}
                        >
                            结束选举
                        </button>
                    </div>
                </>
            )}
            <div className="container-item">
                <button
                    type="button"
                    onClick={fetchElectionHistory} // 点击按钮获取投票历史
                    style={btn}
                >
                    查看投票历史
                </button>
            </div>
            {showHistory && (
                <div className="container-item">
                    <table>
                        <thead>
                        <tr>
                            <th>选举ID</th>
                            <th>选举标题</th>
                            <th>组织标题</th>
                            <th>候选人数量</th>
                            <th>投票人数量</th>
                            <th>状态</th>
                        </tr>
                        </thead>
                        <tbody>
                        {history.map((election, index) => (
                            <tr key={index}>
                                <td>{index}</td>
                                <td>{election.electionTitle}</td>
                                <td>{election.organizationTitle}</td>
                                <td>{election.candidateCount}</td>
                                <td>{election.voterCount}</td>
                                <td>{election.end ? "已结束" : "进行中"}</td>
                            </tr>
                        ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
};

export default StartEnd;
